// import './App.css';
import Header from './components/Headers';
import Home from './components/Home'
import Checkout from './components/Checkout'
import {BrowserRouter as Router, Switch, Route} from "react-router-dom"

function App() {
  return (

      <Router>
        <div className="App">
          <Header />
          <Switch>
          <Route path='/checkout'>
            <Checkout />
          </Route>
          <Route path='/'>
            <Home />
          </Route>
        </Switch>

        </div>
      </Router>



  );
}

export default App;
